INSERT INTO `notes` VALUES (3,101,1671313995,1671313995,'недоделал','<p>&nbsp;при создании новой категории в&nbsp; Select2&nbsp; в&nbsp; итемсах&nbsp; она&nbsp; &nbsp;создается&nbsp; &nbsp;но&nbsp; чтобы она появилась в&nbsp; списке выборан адо перезагружать страницу&nbsp;&nbsp;</p>'),(4,101,1671396885,1671396885,'','<p>где то&nbsp; оставил&nbsp; вчера&nbsp; ошибку&nbsp; из за того&nbsp; что геттер&nbsp; &nbsp;категории&nbsp; переименовал в&nbsp;&nbsp;<span style=\"background-color: rgb(35, 37, 37); color: rgb(152, 118, 170); font-family: &quot;JetBrains Mono&quot;, monospace; font-size: 13px;\">categories</span></p>'),(5,101,1671398212,1671398212,'надо бы','<p>сделать&nbsp; фильтр&nbsp; по категории в&nbsp; товарах&nbsp;&nbsp;</p>'),(6,101,1671398269,1671412266,'сделал','<p>сделать&nbsp; статусы&nbsp;&nbsp;</p><ol><li>&nbsp;сожрал&nbsp; сам&nbsp;</li><li>&nbsp;сожрали они&nbsp;</li><li>испортился</li><li>потерян</li></ol>'),(7,101,1671398298,1671398298,'','<p>сделать экспорт за определенную дату&nbsp;</p>'),(8,101,1671398375,1671398375,'','<p>сделать установку&nbsp; сатусов&nbsp; категорий и&nbsp; &nbsp;места&nbsp; автоматом&nbsp;</p>'),(9,101,1671398478,1671398478,'','<p>сделать&nbsp; названия&nbsp; -&nbsp; чтобы&nbsp; можно&nbsp; было&nbsp; задать название, расшифровку для текущего если оно&nbsp; не&nbsp; понятное&nbsp; из за сокращений&nbsp; &nbsp;и оно подсказывало&nbsp; в&nbsp; бедующем если&nbsp; для этого&nbsp; сокращение&nbsp; ранее&nbsp; название&nbsp; было&nbsp; записано&nbsp;</p>'),(10,101,1671398656,1671398656,'','<p>сделать кнопку&nbsp; <span style=\"font-family: Verdana;\">переключить ширину контента&nbsp;</span></p>'),(11,101,1671479669,1671479669,'сделано','<p>переделал базу&nbsp; на&nbsp; MySQL -&nbsp; &nbsp;потомучто в&nbsp; &nbsp;SQLite&nbsp; &nbsp;не работает поиск по товарам&nbsp; вернее работает но&nbsp; &nbsp;LIKE&nbsp; &nbsp;ищет регистрозависимо а&nbsp; &nbsp; LOWER&nbsp; с&nbsp; русскими символами не&nbsp; справляется&nbsp; &nbsp;</p>'),(12,101,1671479771,1671479771,'сделано','<p>\r\n  переделал базу на MySQL - потомучто в SQLite не работает поиск по товарам вернее работает но LIKE ищет регистрозависимо а LOWER с русскими символами не справляется\r\n</p>'),(13,101,1671479926,1671479926,'не  создается','<p>не&nbsp; создается</p>');
